import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { uuid } from "uuidv4";
import api from "../api/Art";
import "./App.css";
import Header from "./Header";
import AddContact from "./AddContact";
import ContactList from "./ContactList";
import ContactDetail from "./ContactDetail";
import EditContact from "./EditContact";

function App() {
  <Router>
  <center>  
  <div>
  <nav class="navbar navbar-dark bg-dark">


          <ul>

<center><img className="photo" src  = "https://www.nescafe.com/mena/sites/default/files/styles/topic_intro_large/public/C011-TopicIntro-DNES_Gold_Coffee_1600x400%28desktop%29.jpg?itok=17dN7mP8" alt= ""></img></center> 


<button type="button" class="btn btn-dark"><Link to= "./"> Coffee lovers</Link></button>
<button type="button" class="btn btn-dark"><Link to= "./Login">Log in</Link></button>


</ul>



<Switch>

  {/* <Route  exact path= '/AddContact'>
     <App />
  </Route>  */}

  <Route exact  path="/Login" >

    <Login/>
    </Route> 

  <Route exact path= '/' > 
  <App />
  </Route>   

  <Route exact path= '/PageNotFound'>
    <PageNotFound></PageNotFound>
  </Route>


  if(<Route exact path = '/PageNotFound'></Route>){
<center><PageNotFound></PageNotFound>  </center>
  }



  </Switch>
   </nav>
  </div>
  </center>  

    </Router>

  const LOCAL_STORAGE_KEY = "Art";
  const [Art, setArt] = useState([]);

  //RetrieveContacts
  const retrieveContacts = async () => {
    const response = await api.get("/Art");
    return response.data;
  };

  const addContactHandler = async (contact) => {
    console.log(contact);
    const request = {
      id: uuid(),
      ...contact,
    };

    const response = await api.post("/Art", request);
    console.log(response);
    setArt([...Art, response.data]);
  };

  const updateContactHandler = async (contact) => {
    const response = await api.put(`/Art/${contact.id}`, contact);
    const { id, picture } = response.data;
    setArt(
      Art.map((contact) => {
        return contact.id === id ? { ...response.data } : contact;
      })
    );
  };

  const removeContactHandler = async (id) => {
    await api.delete(`/Art/${id}`);
    const newContactList = Art.filter((contact) => {
      return contact.id !== id;
    });

    setArt(newContactList);
  };

  useEffect(() => {
    // const retriveContacts = JSON.parse(localStorage.getItem(LOCAL_STORAGE_KEY));
    // if (retriveContacts) setContacts(retriveContacts);
    const getAllCOntacts = async () => {
      const allContacts = await retrieveContacts();
      if (allContacts) setArt(allContacts);
    };

    getAllCOntacts();
  }, []);

  useEffect(() => {
    //localStorage.setItem(LOCAL_STORAGE_KEY, JSON.stringify(contacts));
  }, [Art]);

  return (
    <div className="ui container">
      <Router>
        <Header />
        <Switch>
          <Route
            path="/"
            exact
            render={(props) => (
              <ContactList
                {...props}
                contacts={Art}
                getContactId={removeContactHandler}
              />
            )}
          />
          <Route
            path="/add"
            render={(props) => (
              <AddContact {...props} addContactHandler={addContactHandler} />
            )}
          />

          <Route
            path="/edit"
            render={(props) => (
              <EditContact
                {...props}
                updateContactHandler={updateContactHandler}
              />
            )}
          />

          <Route path="/Art/:id" component={ContactDetail} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
